import React, { useState } from 'react';
import CalendlyEmbed from '../components/CalendlyEmbed';
import './Contact.css';

const Contact = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    services: [],
    message: '',
    preferredContact: 'email'
  });

  const [isSubmitting, setIsSubmitting] = useState(false);
  const [submitStatus, setSubmitStatus] = useState(null);

  const services = [
    'Energy Healing',
    'Life Coaching',
    'Spiritual Guidance',
    'Meditation Sessions',
    'Chakra Balancing',
    'Intuitive Reading',
    'Not sure yet'
  ];

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;

    if (type === 'checkbox') {
      setFormData(prev => ({
        ...prev,
        services: checked 
          ? [...prev.services, value]
          : prev.services.filter(service => service !== value)
      }));
    } else {
      setFormData(prev => ({
        ...prev,
        [name]: value
      }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);

    // Simulate form submission
    setTimeout(() => {
      setIsSubmitting(false);
      setSubmitStatus('success');
      setFormData({
        name: '',
        email: '',
        phone: '',
        services: [],
        message: '',
        preferredContact: 'email'
      });
    }, 2000);
  };

  return (
    <div className="contact">
      {/* Hero Section */}
      <section className="contact-hero">
        <div className="container">
          <div className="contact-hero-content">
            <h1>Get In Touch</h1>
            <p className="contact-subtitle">
              Ready to begin your healing journey? I'm here to support you every step of the way.
            </p>
          </div>
        </div>
      </section>

      {/* Contact Content */}
      <section className="contact-content">
        <div className="container">
          <div className="contact-grid">
            {/* Contact Form */}
            <div className="contact-form-section">
              <h2>Send Me a Message</h2>
              <p>
                Fill out the form below and I'll get back to you within 24 hours. 
                All information is kept confidential and secure.
              </p>

              {submitStatus === 'success' && (
                <div className="success-message">
                  <h3>Thank you for your message!</h3>
                  <p>I'll get back to you within 24 hours.</p>
                </div>
              )}

              <form onSubmit={handleSubmit} className="contact-form">
                <div className="form-group">
                  <label htmlFor="name">Full Name *</label>
                  <input
                    type="text"
                    id="name"
                    name="name"
                    value={formData.name}
                    onChange={handleChange}
                    required
                    placeholder="Your full name"
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="email">Email Address *</label>
                  <input
                    type="email"
                    id="email"
                    name="email"
                    value={formData.email}
                    onChange={handleChange}
                    required
                    placeholder="your.email@example.com"
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="phone">Phone Number</label>
                  <input
                    type="tel"
                    id="phone"
                    name="phone"
                    value={formData.phone}
                    onChange={handleChange}
                    placeholder="(555) 123-4567"
                  />
                </div>

                <div className="form-group">
                  <label>Service Interests (Select all that apply)</label>
                  <div className="checkbox-group">
                    {services.map((service) => (
                      <label key={service} className="checkbox-label">
                        <input
                          type="checkbox"
                          name="services"
                          value={service}
                          checked={formData.services.includes(service)}
                          onChange={handleChange}
                        />
                        <span>{service}</span>
                      </label>
                    ))}
                  </div>
                </div>

                <div className="form-group">
                  <label>Preferred Contact Method</label>
                  <div className="radio-group">
                    <label className="radio-label">
                      <input
                        type="radio"
                        name="preferredContact"
                        value="email"
                        checked={formData.preferredContact === 'email'}
                        onChange={handleChange}
                      />
                      <span>Email</span>
                    </label>
                    <label className="radio-label">
                      <input
                        type="radio"
                        name="preferredContact"
                        value="phone"
                        checked={formData.preferredContact === 'phone'}
                        onChange={handleChange}
                      />
                      <span>Phone</span>
                    </label>
                  </div>
                </div>

                <div className="form-group">
                  <label htmlFor="message">Message *</label>
                  <textarea
                    id="message"
                    name="message"
                    value={formData.message}
                    onChange={handleChange}
                    required
                    rows="5"
                    placeholder="Tell me about your needs and how I can help you..."
                  />
                </div>

                <button 
                  type="submit" 
                  className="btn submit-btn"
                  disabled={isSubmitting}
                >
                  {isSubmitting ? 'Sending...' : 'Send Message'}
                </button>
              </form>
            </div>

            {/* Contact Info */}
            <div className="contact-info-section">
              <h2>Contact Information</h2>

              <div className="contact-methods">
                <div className="contact-method">
                  <div className="contact-icon">üìß</div>
                  <div>
                    <h3>Email</h3>
                    <p>hello@kalyanamitta.com</p>
                    <p>I typically respond within 24 hours</p>
                  </div>
                </div>

                <div className="contact-method">
                  <div className="contact-icon">üì±</div>
                  <div>
                    <h3>Phone</h3>
                    <p>(555) 123-4567</p>
                    <p>Available Mon-Fri, 9 AM - 6 PM PST</p>
                  </div>
                </div>

                <div className="contact-method">
                  <div className="contact-icon">üìç</div>
                  <div>
                    <h3>Location</h3>
                    <p>In-Person & Virtual Sessions</p>
                    <p>Flexible options to meet your needs</p>
                  </div>
                </div>
              </div>

              <CalendlyEmbed />

              <div className="survey-info">
                <h3>Help Us Help You</h3>
                <p>
                  Complete our optional Google survey to help us better understand your needs 
                  and provide more personalized guidance.
                </p>
                <a href="https://forms.gle/your-survey-link" target="_blank" rel="noopener noreferrer" className="btn btn-secondary">
                  Take Survey
                </a>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Contact;
